import React, { useState } from 'react';

export default function Dalle() {
    const [inputText, setInputText] = useState('');

    const handleInputChange = (event) => {
        setInputText(event.target.value);
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        console.log('Input Text:', inputText);
        setInputText('');
    };

    return (
        <div className="container" style={{ padding: '20px', maxWidth: '600px', marginTop: "70px" }}>
            <h1>Dalle Text Input</h1>
            <p>
                Welcome to the Dalle Text Input page! Enter some text in the input field below and click the submit button
                to perform actions with the text.
            </p>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="textInput">Enter Text:</label>
                    <input
                        type="text"
                        id="textInput"
                        value={inputText}
                        onChange={handleInputChange}
                        placeholder="Type your text here"
                        className="form-control"
                    />
                </div>
            </form>
            {inputText && (
                <div style={{ marginTop: '20px' }}>
                    <h3>Input Text:</h3>
                    <p>{inputText}</p>
                </div>
            )}
        </div>
    );
}
